import { Line } from "react-chartjs-2";
const Chart = (props) => {
  return (
    <Line
      data={{
        labels: props.x.slice(-300),
        datasets: [
          {
            label: "Cases",
            data: props.y.slice(-300),
            backgroundColor: "rgba(255, 99, 132, 0.6)",
          },
        ],
      }}
      options={{
        responsive: true,
        title: {
          display: true,
          text: "Largest Cities In Cali",
          fontSize: 25,
        },
      }}
    />
  );
};

export default Chart;
